    private void jButton4MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jButton4MouseClicked
        // TODO add your handling code here:
             
               String clgname=clg_drop2.getSelectedItem().toString();
         if(clgname.equals("COE")){
        DefaultCategoryDataset linedata=new DefaultCategoryDataset();
        linedata.setValue(qone1,"Course Rating","AED");
        linedata.setValue(qtwo4,"Course Rating","DMDD" );
        linedata.setValue(qthree5,"Course Rating","DS" );
   
        JFreeChart linechart=ChartFactory.createLineChart("Course Popularity", "Course Rating", "Average Ranking", linedata);
        ChartPanel panel=new ChartPanel(linechart);
        setContentPane(panel);
        JFrame frame=new JFrame();
        frame.getContentPane().add(panel);
        frame.pack();
        frame.setVisible(true);
         }
         else if(clgname.equals("CPS")){
        DefaultCategoryDataset linedata=new DefaultCategoryDataset();
        linedata.setValue(ccone1,"Course Rating","PM");
        linedata.setValue(cctwo4,"Course Rating","CM" );

        JFreeChart linechart=ChartFactory.createLineChart("Course Popularity", "Course Rating", "Average Ranking", linedata);
        ChartPanel panel=new ChartPanel(linechart);
        setContentPane(panel);
        JFrame frame=new JFrame();
        frame.getContentPane().add(panel);
        frame.pack();
        frame.setVisible(true);
         }
        

    }//GEN-LAST:event_jButton4MouseClicked

